import TeamItem from "../TeamItem/TeamItem";

function TeamList(props) {
  return (
    <section>
      {props.images.map((e, i) => {
        return <TeamItem key={i} image={e} name={props.names[i]} job={props.jobs[i]}/>;
      })}
    </section>
  );
}

export default TeamList;
